import React, {useState} from 'react';

const Display = (props) => {

    console.log(movieData);

    if (props.fetched === false) {

        let moviesDisplay = props.movieData.results.map((movies, index) => {
            return (
                <div key={index}>{movies.original_title}</div>
            )
        })

        return (
            <div>
                {moviesDisplay}
            </div>
        )
    }
}

export default Display;
